import Table from 'react-bootstrap/Table';

function TableComp({data}) {
    console.log(data);
    return (
        <Table striped bordered hover variant="dark">
            <thead>
                <tr>
                    <th>Id</th>
                    <th>Name</th>
                    <th>Email</th>
                    <th>Addres</th>
                </tr>
            </thead>
            <tbody>
               
            </tbody>
        </Table>
    );
}

export default TableComp;
